  useEffect(() =>{
    const hash = getTokenFromUrl();
    const token = hash.access_token;
    console.log("I have token",token);
    window.location.hash = "";
    const token2 = hash.access_token;
    console.log(token2);
  },[]);


  return (
    <div className="App">
      <Login/>
    </div>
  );
}

export default App;
